import React from "react";
import { Link } from "react-router-dom";

function Unauthorized() {
  return (
    <div>
      <h1>Unauthorized</h1>
      <p>You must be logged in to view this page.</p>
      <button>
        <Link to="/login">Login</Link>
      </button>
    </div>
  );
}

export default Unauthorized;
